export class Login extends Component {
  constructor() {
    super();
    this.state = {
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <div>
        <form>
          <h1>Please sign in</h1>
        </form>
      </div>
    );
  }
}

export default Login;
